import "./portfolio.scss";
import { useEffect, useState } from "react";
import PortfolioList from "../portfolioList/PortfolioList";
import { featuredPortfolio, crudPortfolio, socialNetPortfolio, loginRegPortfolio, eCommercePortfolio, contentPortfoli } from "../../data";

export default function Portfolio() {
    const [selected, setSelected] = useState("featured")
    const list = [
        {
            id: "featured",
            title: "Featured",
        },
        {
            id: "crud",
            title: "C.R.U.D.",
        },
        {
            id: "SocialApp",
            title: "Social-networking App",
        },
        {
            id: "Login",
            title: "Login & Registration App",
        },
        {
            id: "Design",
            title: "E-Commerce Design",
        },
        {
            id: "content",
            title: "Content",
        }
    ]
    return (
        <div className="portfolio" id="portfolio">
            <h1>Portfolio</h1>
            <ul>
                {list.map((item) => (
                    <PortfolioList 
                        title={item.title} 
                        active={selected === item.id} 
                        setSelected={setSelected}
                        id={item.id}
                    />
                ))}
            </ul>
            <div className="container">
                <div className="item">
                    <img src="assets/Crud.gif" 
                    alt="" 
                />
                <h3>Login App</h3>
                </div>
                <div className="item">
                    <img src="assets/Crud.gif" 
                    alt="" 
                />
                <h3>E-Commerce App</h3>
                </div>
                <div className="item">
                    <img src="assets/Crud.gif" 
                    alt="" 
                />
                <h3>Crud App</h3>
                </div>
                <div className="item">
                    <img src="assets/Crud.gif" 
                    alt="" 
                />
                <h3>Social App</h3>
                </div>
                
            </div>
        </div>
    )
}
